;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"144\" height=\"279\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x283aae62 \"BufferedImage@283aae62: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@470b9cdf transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 144 height = 279 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

(def desc1 (new-mat))
(.compute extractor mat1 points1 desc1)
(def desc2 (new-mat))
(.compute extractor mat2 points2 desc2)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def matcher 
  (DescriptorMatcher/create DescriptorMatcher/BRUTEFORCE_HAMMINGLUT))

(def matches 
  (new-matofdmatch))

(.match matcher desc1 desc2 matches)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@

(defn best-n-dmatches2[dmatches]
  (new-matofdmatch
    (into-array org.opencv.core.DMatch
      (filter #(< (.-distance %) 10) (.toArray dmatches)))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;wandering-moss/best-n-dmatches2</span>","value":"#'wandering-moss/best-n-dmatches2"}
