(defn draw-matches [_mat1 _points1 _mat2 _points2 _matches]
  (let[ _mat (new-mat (* 2 (.rows _mat1)) (* 2 (.cols _mat1)) (.type _mat1))
        _sorted-matches (best-n-dmatches2 _matches)]

    (Features2d/drawMatches
              _mat1 
              _points1
              _mat2
              _points2
              _sorted-matches
              _mat
              rgb/pink-1
              (new-scalar 0 0 255)
              (new-matofbyte)
              Features2d/NOT_DRAW_SINGLE_POINTS)
      _mat))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;wandering-moss/draw-matches</span>","value":"#'wandering-moss/draw-matches"}
;; <=

;; @@
(u/mat-view
  (draw-matches mat1 points1 mat2 points2 matches))
