(defn best-n-dmatches2[dmatches]
  (new-matofdmatch
    (into-array org.opencv.core.DMatch
      (filter #(< (.-distance %) 50) (.toArray dmatches)))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;wandering-moss/best-n-dmatches2</span>","value":"#'wandering-moss/best-n-dmatches2"}
